import React, { Component } from 'react'
import MyNavLink from '../MyNavLink'

export default class NavItem extends Component {

    props = {
        id:'', 
        to:'', 
        itemName:''
    }

    render() {
        const {id, to, itemName} = this.props;
        console.log(id + "," + to + "," + itemName);
        return (
            <li>
                <MyNavLink to={"/"+to}>
                    {itemName}
                </MyNavLink>
            </li>
        )
    }
}
